import { useEffect,useState } from 'react'
import axios from 'axios'
import React from 'react'

const WhoAmI = () => {
    const[users,setUsers]=useState({
        basespace:[]
    })
    useEffect(() => {
		axios.get('https://api.basespace.illumina.com/v1pre3/users/29912883').then((res) => {
			const allUsers = res.data;
			setUsers({ loading: false, basespace: allUsers });
			console.log(res.data);
		});
	}, [setUsers]);
    return (
        <div>
            {users.basespace.map((item)=>{
                return(
                    <div key={item.id}>

                        <h2>{item.Name}</h2>
                    </div>

                )

            })}

        </div>
    )
}

export default WhoAmI
